import React from "react";

import whatsappIcon from "../../assets/images/icons/whatsapp.svg";

import "./styles.css";

interface TeacherItemProps {
  teacher: {
    id: number;
    name: string;
    avatar: string;
    bio: string;
    cost: number;
    subject: string;
    whastapp: string;
  };
}

function TeacherItem() {
  return (
    <article className="teacher-item">
      <header>
        <img
          src="https://avatars3.githubusercontent.com/u/33527486?s=460&u=cec269e928a22a2c920ca39b0b92bab4c4b164fa&v=4"
          alt="Denilson Sousa"
        />
        <div>
          <strong>Denilson Sousa</strong>
          <span>Física</span>
        </div>
      </header>
      <p>
        Entusiasta das melhores tecnologias de física avançada.
        <br />
        <br />
        Apaixonado por repassar os ensinamentos de Einstein e por mudar a vida
        das pessoas através de experiências.
      </p>
      <footer>
        <p>
          Preço/hora
          <strong>R$100,00</strong>
        </p>
        <button type="button">
          <img src={whatsappIcon} alt="WhatsApp Icon" />
          Entrar em Contato
        </button>
      </footer>
    </article>
  );
}

export default TeacherItem;
